import React, { useState, useEffect } from "react";
import axios from "axios";
import Table from "react-bootstrap/Table";

function SeeToxicPatients() {
  const token = localStorage.getItem("token");
  const [loadedData, setLoadedData] = useState([]);
  const [toxicPatients, setToxicPatients] = useState([]);
  const [blockedPatients, setBlockedPatients] = useState([]);

  const loadData = async () => {
    const url = "http://localhost:56210/patients/allToxic";
    try {
      const data = await fetch(url, {
        headers: { Authorization: `Bearer ${token}` },
      });
      const data1 = await data.json();
      console.log(data1);
      setLoadedData(data1);
      let blocked = data1.filter((e) => e.isBlocked);
      let toxic = data1.filter((e) => e.isBlockable);

      console.log(toxic);
    } catch (error) {
      console.log("error", error);
    }
  };

  const table = (
    <Table>
      <thead>
        <th>#</th>
        <th>Patient name</th>
        <th>Patient surname</th>
      </thead>
    </Table>
  );

  useEffect(() => {
    loadData();
  }, []);

  return <div>S</div>;
}

export default SeeToxicPatients;
